    clockwise = clockwise or 0
    local S = "m %.3f %.3f l %.3f %.3f l %.3f %.3f "
    local a = length/2
    local b = a/2*3^0.5
    local c = a/2
    if clockwise == 0 then
        return string.format(S,-b,c,0,-a,b,c)
    elseif clockwise == 1 then
        return string.format(S,b,c,0,-a,-b,c)
    end
end

